import React from 'react';
import Welcome from '../../Welcome';
import Work from '../../Work';
import WorkReverse from '../../WorkReverse';
import {homeObjOne, recentWorkOne, recentWorkTwo, recentWorkThree} from './Data';


function Portfolio() {
    return (
        <>
            <section>
                <div className="header-container">
                    <img className="flower-background" src="../../images/sfFlower2.jpg" alt="flowers"/>
                    <div className="header-text-wrapper">
                        <h1>
                            Wuss Hannin'
                        </h1>
                        <h3>
                            its a beautiful obsession
                        </h3>
                    </div>
                </div>
            </section>
            <Work {...recentWorkOne} />
            <WorkReverse {...recentWorkTwo} />
            <Work {...recentWorkThree} />
        </>
    );
}

export default Portfolio;
